INSERT INTO `t_book` VALUES ('3', '', '246560', '10', '10p24.32', '95300000', '104000000', '', null, 'FBXW4', '16688749', '劈裂手足畸形是一种肢体畸形，表现并手、并趾，正中裂的手和脚，和再生障碍性贫血和/或发育不全的指骨，掌骨，跖骨。一些SHFM3病人被发现有智力低下，和颜面部裂。', 'AD', '裂手裂足症3型', '', 'Fetal Chip', 'GRCh38\r');
