INSERT INTO `t_book` VALUES ('7', '', '153480', '10', '10q23.31', '', '', '', null, 'PTEN', '10400993', 'Bannayan-Riley-Ruvalcaba综合征（BRR、MIM号153480），其特征是大头畸形、脂肪过多症、血管瘤过多症和有斑点的阴茎。约60%的BRR家族和分散的病例都联合携带着PTEN的胚系突变。 ', 'AD', '巨头、多发脂肪瘤和血管瘤综合', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('8', 'Split-hand/foot malformation 3 (SHFM3)', '246560', '10', '10q24.1', '95300000', '104000000', '重复', null, 'FBXW4', '12913067', '远端肢体末梢中线的肢体畸形，并指畸形，手脚的正中裂，先天萎缩或发育不全的指骨、掌骨、跖骨，智力障碍，外胚层的发育和颅面会产生变化，以及面部腭裂', 'AD', '3型手足裂畸形', '', 'GSVMP', 'GRCh38\r');
