INSERT INTO `t_book` VALUES ('15', 'Jacobsen syndrome', '147791', '11', '11q23', '110600000', '121300000', '缺失', 'deletion', 'BSX, NRGN', '18855024', '胎儿宫内发育迟缓，智力障碍，微/巨脑畸形，小颌畸形，低位耳，不同的眼部症状（眼距过宽、内眦，睑裂），凹陷的鼻梁，短鼻子，室间隔缺损，肋骨缺失，漏斗胸，幽门狭窄，泌尿生殖系统异常（尿道下裂，是发育不全的女性外生殖器），关节挛缩，五指，短指畸形，肌张力低下', 'IC', 'Jacobsen 综合征', '', 'GSVMP', 'GRCh38\r');
