INSERT INTO `t_book` VALUES ('56', '', '301040', '16', '16p13.3', '', '', '', null, 'ATRX,SOX8', '', '产后生长缺陷，头小畸形，额窦缺失，脸中发育不全，低位耳，感觉神经性耳聋，眼距过宽，小三角鼻，鼻孔前倾，低鼻梁，厚嘴唇，舌头隆起，上门牙宽缝，膜周部室间隔缺损，脐疝，便秘，胃食管反流，小阴茎，尿道下裂，隐睾症，肾缺如，肾积水，脊椎后侧凸，半脊椎畸形，髋外翻，锥形手指，指弯曲，畸形足，智力迟钝，发展延迟，表达障碍，张力减退，痉挛，癫痫，大脑萎缩，低色小红细胞性贫血，地中海贫血', 'XLD', '甲型地中海型貧血', '', 'Fetal Chip', 'GRCh38\r');
