INSERT INTO `t_book` VALUES ('59', 'Alveolar capillary dysplasia with misalignment of pulmonary veins (ACD/MPV)', '265380', '16', '16q24.1', '', '', '缺失', 'deletion', 'FOXF1', '19500772', '肺动脉高压，右向左分流经卵圆孔或动脉导管未闭，肺静脉分支错位，细动脉肌化增加，肺小叶和空域壁毛细血管发育不良', 'AD', '肺泡毛细血管发育不良和肺静脉', '', 'GSVMP', 'GRCh38\r');
