INSERT INTO `t_book` VALUES ('65', 'Hereditary neuropathy with liability to pressure palsies (HNPP)', '162500', '17', '17p12 ', '', '', '缺失', 'deletion', 'PMP22', '8422677', '复发性局灶性压力神经麻痹，如腕管综合征和/或足下垂腓神经麻痹，正中神经传导潜伏期延长。', 'AD', '遗传性压迫易感性神经病', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('66', '', '219800', '17', '17p13.2-p13.3', '', '', '', null, 'CTNS', '', '身高体重发育缓慢，恐光，视网膜病，角膜糜烂。串珠肋，肝/脾肿大，胰功能不全，肾衰竭，肾结石，佝偻病，肌肉萎缩，大脑萎缩，酸中毒，多尿症，烦渴，甲状腺功能衰退，', 'AR', '胱胺酸症', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('67', 'Miller-Dieker- syndrome', '247200', '17', '17p13.3', '', '', '缺失', 'deletion', 'PAFAH1B1 (LIS1), YWAHE', '3050093', '无脑回畸形，小头畸形，皮肤皱纹在眉间、额缝，突出枕，窄额头，向下斜裂缝，小鼻子和下巴，心脏畸形，发育不全的男性外生殖器，发育迟缓，智力障碍和发育障碍与癫痫发作和脑电图异常 ', 'AD', 'Miller-Dieker综', '', 'GSVMP', 'GRCh38\r');
