INSERT INTO `t_book` VALUES ('70', 'Koolen-De Vries syndrome', '610443', '17', '17q21.31', '', '', 'deletion', 'deletion', 'MAPT, CRHR1', '22544363', '中度DD /学习障碍，新生儿肌张力低下，婴儿期喂养困难，oromotor运动障碍，癫痫，心脏缺损（ASD，VSD），肾脏/泌尿系统异常。银色头发的色素脱失，随着年龄的增长有一个明显的粗化的面部特征，友好亲切的行为。', 'AD', '17q21.31片段缺失', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('71', '', '114290', '17', '17q24.3', '', '', 'deletion', 'deletion', 'SOX9', '', '侏儒症，大前卤，巨头畸形，高前额，小平脸，小颌畸形，低位耳，听力缺失，眼宽过距，短眼脸裂，腭裂，先天心脏缺陷，支气管软化症，呼吸困难，小胸廓，肩胛骨发育不全，肋骨细长，无胸骨矿化，11对肋骨，性反转，髋关节脱位，短趾骨，畸形足，腿骨弯曲，嗅神经球（束）缺失，张力减退，脑积水，羊水过多，大多数新生儿由于呼吸不足', 'AD', '短指發育不良及性別反转', '', 'Fetal Chip', 'GRCh38\r');
