INSERT INTO `t_book` VALUES ('76', '', '119300', '1', '1q32.2', '', '', '', null, 'IRF6', '11668635', 'Van Der Woude综合征（VWS）又称唇瘘、腭裂及唇裂综合征，其特征是家族性下唇瘘复合唇裂或腭裂，患者通常智力正常，可伴有缺牙。', 'AD', '范德伍兹综合征1型', 'VWS 在人群中的发病率为1-3/30000，在临床唇腭裂患者中所占比例约为0.4%，遗传外显率高达80-94%。', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('77', '', '#612530', '1', '1q41-q42', '', '', '', null, 'multiple', '17873649', '常见的临床表现为明显的发育迟缓和明显的面部畸形，如前额突出，眼睛深陷，宽鼻尖，鼻梁扁平，鼻孔前倾。有些在婴儿期有粗糙面部，小头畸形，腭裂，畸形，癫痫发作，和矮小。', '散发', '1q41-q42片段缺失', '万分0.7', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('78', '', '118450', '20', '20p12.2', '', '', '', null, 'JAG1', '', '眼睛异常（近视，斜视，白内障，器官过距），肺动脉狭窄，心房/室中隔缺损，法洛四联症，主动脉缩窄，中风，肝疾病，肾发育/功能不全，骨骼发育异常，智力迟钝，学习困难，血胆脂醇过多', 'AD', '阿拉吉歐徵候群', '', 'Fetal Chip', 'GRCh38\r');
