INSERT INTO `t_book` VALUES ('81', 'Cat-eye syndrome', '115470', '22', '22q11', '15000000', '25500000', '22三体', null, '', '3961499', '先天性虹膜缺损，肛门闭锁伴瘘，睑裂下斜，耳前窝/耳前赘，频发心脏和肾脏畸形，智力发展接近正常', 'AD', '猫眼综合征', '', 'GSVMP', 'GRCh38\r');
