INSERT INTO `t_book` VALUES ('97', '', '193510', '3', '3p14.1', '', '', '', null, 'MITF', '', '耳聋，异色症，连眉，宽鼻梁，鼻翼发育不全，先天性白化病，白眉/睫毛/额发', 'AD', '瓦登伯革氏症候群', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('98', '', '220200', '3', '3q24', '129500000', '149200000', '', null, 'ZIC1, ZIC4', '', '放射学（后窝骨变薄、膨胀，小脑蚓体部分或完全缺失，后窝囊肿），第四脑室膨胀脑积水，枕骨突出，眼球震颤，身体失调，脑神经麻痹，', 'AR', 'Dandy-Walker氏症', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('99', '', '206900', '3', '3q26.33', '', '', '', null, 'SOX2', '', '身材矮小，小头畸形，额头隆起，听力缺失，小眼/无眼，视神经发育不全，心室中隔缺损，动脉导管未闭，肋骨异常，食管闭锁，尿道下裂，小阴茎，隐睾症，半椎体，脊椎发育不全，中央神经系统（白质减少，下丘脑错构瘤，脑畸形，胼胝体/垂体前叶发育不全，学习困难，精神运动迟缓，张力减退，痉挛性双瘫，低促性腺素性功能减退症）', 'AD', '小眼綜合症', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('100', '3q29 deletion syndromes', '609425', '3', '3q29', '192600000', '198295559', '缺失', 'deletion', 'PAK2, DLG1', '15918153', '临床特征变化大。可能包括轻度/中度ID与轻度畸形的面部特征，包括狭长的脸，人中短，高鼻梁，自闭症，共济失调，胸壁畸形，长、尖细的手指，小头畸形', 'IC', '', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('101', '3q29 duplication syndromes', '611936', '3', '3q29', '192600000', '198295559', '重复', null, '', '18471269', '轻微的精神发育迟滞和轻微的畸形特征,小头畸形，圆圆的脸，蒜头鼻，短或睑裂过大的手，皱纹，和平底足。', 'AD', '', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('102', 'Wolf-Hirschhorn syndrome', '194190', '4', '4p16.3', '', '', '缺失', 'deletion', '', '25251057', '出生体重低，发育缓慢，头小畸形，发育障碍，肌张力低下，癫痫，面部表现为下眼睑外翻，“希腊头盔”的轮廓，短鼻子和短人中，虹膜缺损', 'IC', 'Wolf-Hirschhor', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('103', 'Parkinson disease', '168601', '4', '4q22.1', '', '', '重复, Triplication', null, 'SNCA', '8895469', '静止性震颤，肌肉僵直，运动迟缓，姿势异常/不稳，自主神经异常，肌张力异常性抽筋，以及痴呆', 'AD', '帕金森病', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('104', '', '180500', '4', '4q25', '', '', '', null, 'PITX2', '', '上颌骨发育不全，眉框突出，青光眼，瞳孔移位/异常，多瞳症，小/巨角膜，斜视，宽鼻梁，薄嘴唇，牙发育不全，脐带缺点，肛门闭锁，生长激素缺乏', 'AD', '里格尔综合征', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('105', 'Cornelia de Lange syndrome', '608667', '5', '5p13.2', '36876758', '37065818', '缺失', 'deletion', 'NIPBL', '15146186', '特征脸部（低前发际线，一字眉，鼻孔前倾，上颌前突，人中长，“鲤鱼”口），产前和产后发育迟缓，智力缺陷和上肢畸形', 'AD', '德朗热综合征', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('106', 'CRI-DU-CHAT SYNDROME', '123450', '5', '5p15.2', '', '', '缺失', 'deletion', ' TERT', '11238681', '因为婴儿的喉头和神经系统异常，所以患有此症的婴儿会发生猫啼般的哭声。新生儿期肌力低下，明显的智力低下、智力发育迟缓。', 'N/A', '猫叫综合征', '新生儿中1/2万-5万', '', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('107', '5q14.3 deletion syndrome', '613443', '5', '5q14.3', '', '', '缺失', 'deletion', 'MEF2C', '19592390', '重度智力缺陷，癫痫、肌张力低下', 'IC', '5q14.3缺失综合征', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('108', '', '—', '5', '5q21.1-q31.2', '', '', '', null, '', '', '胎儿期生长停滞，小头/短头畸形，小颌畸形，听力缺失，近视，眼睑下垂，鼻孔前倾，高颚穹，兔唇，肺炎，先天性膈疝，胃食管反流，幽门狭窄，隐睾症，生殖器发育不全，肾结构异常，骨盆膨胀，肾功能减退，海豹肢症，少指，多毛症，自我伤害行为，婴儿期哭声低沉，咆哮，', 'AD', '5q21.1-q31.2缺失', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('109', '', '154500', '5', '5q33.1（5q32-q33）', '', '', '', null, 'TCOF1', '', '颧骨发育不全，传导性耳聋，下眼睑缺损，腭裂，颚咽机能不全，下颌发育不全，巨口', 'AD', 'Treacher Colli', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('110', '', '108900', '5', '5q35.1', '', '', '', null, 'NKX2-5', '', '心房间隔缺损，房室传导缺陷，心房颤动，室中隔缺损，法洛四联症，左心室肥大，主动脉瓣下载，肺动脉，闭锁，二尖瓣', '', '小腦症; 先天性心臟病', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('111', 'Sotos syndrome', '117550', '5', '5q35.3', '', '', '缺失', 'deletion', 'NSD1', '11896389', '巨颅，长头，前额突出，明显的眼距较大，高拱形腭，出生时身高和体重较大，儿童期生长过快，过大的手和脚，肌张力低下，智力发育障碍和语言发展延迟。', 'IC', '小儿巨脑畸形综合征即脑性巨人', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('112', '', '119600', '6', '6p12.3', '', '', '', null, 'RUNX2', '', '骨硬化，易脆，额窦/鼻旁窦发育不全，椎骨脱离/前移，脊椎侧凸，驼背，趾骨矿化迟缓，髋外翻，指过短', 'AD', '鎖顱骨發育異常症', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('113', 'Cleidocranial dysplasia', '600211', '6', '6p21.1', '45327799', '45664031', '缺失', 'deletion', 'RUNX2', '9182765', '颅缝不闭合，突出的颅骨，锁骨发育不全，趾骨联合，第五个手指的中节指骨短，牙畸形，脊椎畸形', 'AD', '颅骨锁骨发育不良', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('114', '', '176270', '6', '6q16.3', '', '', 'deletion', 'deletion', 'SIM1（NDN/SNRPN）', '', '身材矮小，中等肥胖，低氧，低促性腺素性功能减退症，生殖器发育不全，隐睾症，月经过稀，小手足，指弯曲，并指，智力迟钝，学习障碍，癫痫，多食症，高胰岛素血，生长激素缺乏', 'IC', 'Prader-Willi-l', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('115', 'Greig cephalopoly- syndactyly syndrome', '175700', '7', '7p14.1', '', '', '缺失/ 重复', null, 'GLI3', '14608643', '颅缝早闭，（聚）并趾畸形，小头畸形，舟状头，高额头，前额突出，眼距过宽，睑裂下斜，宽鼻根，智力正常', 'AD', '格雷格多发并趾头部畸形综合征', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('116', 'Saethre-Chotzen syndrome', '601622', '7', '7p21.1', '19113046', '19117671', '缺失', 'deletion', 'TWIST1', '8988167', '不对称的脸，颅缝早闭，小耳朵，长而突出的耳垂，并指畸形（通常第三、四脚趾和/或二、三手指），发育障碍', 'AD', 'Saethre-Chotze', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('117', '7q11.23duplication syndrome', '609757', '7', '7q11.23', '72700000', '77900000', '重复', null, '', '16236740', '轻度发育迟缓，微小的面部畸形，包括高和阔的鼻子，人中短，严重的语言表达延迟（特别是语法和语音）', 'N/A', '', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('118', 'Williams-Beuren syndrome', '194050', '7', '7q11.23 ', '72700000', '77900000', '缺失', 'deletion', ' ELN', '12952863', '是一种罕见的神经发育异常，患者鼻根较低，拥有像小精灵的外观，且脸部特征随年龄增长而更加明显。大部分病人智能不足但语言能力较正常人好，行为举止异常兴奋且不怕生。症状还包括心血管疾病如主动脉瓣上狭窄与高血钙。', 'AD', '威廉氏综合症', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('119', '7q11.23 distal deletion syndrome', '613729', '7', '7q11.24', '72700000', '77900000', '缺失', 'deletion', ' HIP1, YWHAG', '21109226', '癫痫，学习障碍，智力障碍，和/或神经行为异常', 'N/A', '', '', 'GSVMP', 'GRCh38\r');
