INSERT INTO `t_book` VALUES ('121', '', '115150', '7', '7q34', '', '', '', null, 'BRAF', '', '身材矮小，巨/长头畸形，面部结构突出，粗糙，小颌畸形，低位耳，听力缺失，眼睑下垂，眼球震颤，斜视，眼宽过距，眼球突出，内眦赘皮，近视，视神经发育不良，动眼神经失用症，腭裂，高颚穹，咬合不正，心房中隔缺损，肺动脉狭瓣，漏斗胸/鸡胸，脾肿大，骨骼发育异常，过敏性皮炎，鱼鳞藓，多小痣，毛发角化病，智力迟缓，癫痫，张力减退，张力亢进，脑积水，皮质萎缩，大脑前叶/脑胼胝体发育不良，神经病', 'AD', '皮膚症候群', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('122', 'Currarino syndrome', '176450', '7', '7q36.3', '', '', '缺失', 'deletion', 'MNX1', '10631160', '半骶骨伴有完整的第一骶椎（“镰刀形骶骨”），骶前肿块，和肛门直肠畸形', 'AD', 'Currarino三联症', '', 'GSVMP', 'GRCh38\r');
