INSERT INTO `t_book` VALUES ('134', 'Tuberous sclerosis-1     ', '605284', '9', '9q34.13', '132891347', '132945369', '缺失', 'deletion', 'TSC1', '9328481', '多系统器官中存在错构瘤和癫痫，学习困难、行为存在问题，以及皮损', 'AD', '结节性脑硬化', '', 'GSVMP', 'GRCh38\r');
