INSERT INTO `t_book` VALUES ('136', 'Xp11.22-p11.23deletion syndrome', '–', 'X', 'Xp11.22-p11.23', '', '', '重复', null, '', '19716111', 'ID, 语言障碍，脑电波异常。', '', '', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('137', 'Focal dermal hypoplasia/Goltz syndrome', '305600', 'X', 'Xp11.23', '', '', '缺失', 'deletion', 'PORCN', '17546030', '皮肤萎缩及线状色素沉着，脂肪可由真皮缺陷部位向外突出，粘膜或皮肤有乳头状瘤，手指异常（畸形，多指畸形，屈曲指），唇部乳头状瘤，牙齿发育不全，眼部异常（虹膜缺损和脉络膜，斜视，小眼畸形），智力障碍', 'XLD', '灶性皮肤发育不良（Goltz', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('138', 'Norrie disease', '310600', 'X', 'Xp11.3', '', '', '缺失', 'deletion', 'NDP', '17431911', '视网膜退行性和增生性的变化导致过早的儿童失明，渐进式的智力障碍通常伴有精神病特性，感音神经性耳聋，生长障碍和癫痫', 'XLR', '诺里病，进行性眼听大脑病变', '', 'GSVMP', 'GRCh38\r');
