INSERT INTO `t_book` VALUES ('151', '', '311200', 'X', 'Xp22.2', '', '', '', null, 'OFD1', '', '面部骨骼发育不全，听力缺失，内眦赘皮，腭裂，唇裂，牙齿发育不全，心脏反常，肝纤维化，胰腺囊肿，卵巢囊肿，骨骼发育异常（多指，并指，指弯曲），秃头，智力迟缓，脑胼胝体缺失，脑积水，下丘脑错构瘤，癫痫，脑穿通，抑郁症，', 'XLD', '口面指[趾]综合征', '', 'Fetal Chip', 'GRCh38\r');
