INSERT INTO `t_book` VALUES ('164', '', '300624', 'X', 'Xq27.3', '', '', '', null, 'FMR1', '', '巨头畸形，长脸，面部粗糙，二尖瓣脱垂，漏斗胸，大睾丸， 脊柱侧凸,扁平足，精神迟缓，癫痫，头活动不正常，多动冲动行为，眼神接触贫乏，自闭症倾向', 'XLD', 'X染色體脆折症；', '', 'Fetal Chip', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('165', 'Lubs syndrome', '300260', 'X', 'Xq28', '', '', '重复, Triplication', null, 'MECP2', '10398236', '复发性感染，婴儿肌张力过低导致童年期痉挛，重度智力障碍，无法学习语言，胃食管返流，吞咽困难，面部肌张力低下，过度流口水，行走能力有限或无力行走', 'XLR', 'Lubs综合征', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('166', 'Rett syndrome', '312750', 'X', 'Xq28', '', '', '缺失', 'deletion', 'MECP2', '10508514', '6-18月龄发育停止，获得的能力会衰退，语言能力丧失，动作刻板（典型的是手部动作），小头畸形，癫痫，发育障碍', 'XLD', 'Rett综合征', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('167', '', '300260', 'X', 'Xq28', '', '', 'duplication', null, 'MECP2', '', '反复感染，小儿肌张力低，严重ID，语言发张障碍，胃食管反流，吞咽困难，面部肌张力低下，过度流口水，无力或行走能力有限', 'X连锁隐性', '', '', 'Fetal Chip', '\r');
INSERT INTO `t_book` VALUES ('168', 'AZFa', '415000', 'Y', 'Yq11.2', '', '', '缺失', 'deletion', 'USP9Y, DB9', '15287977', '男性不育，无精子症、严重少精子症', 'Y染色体连锁', 'AZFa', '', 'GSVMP', 'GRCh38\r');
INSERT INTO `t_book` VALUES ('169', '5q35 duplication syndrome', '–', '', '', '', '\r', '重复', null, '', '', '身材矮小，小头畸形和语音延迟', '', '', '', 'GSVMP', '\r');
INSERT INTO `t_book` VALUES ('170', 'Edward Syndrome', '', '', '', '', '\r', '18三体', null, '', '', '爱德华氏综合征患者会出现体重过轻、头颅过小以及形状异常、颚骨过小、嘴巴过小、耳朵位置过低、拳头强制收紧以及手指重叠等问题。患者也会有心脏不健全以及其他的器官畸形、残废的问题。', '', '爱德华氏综合征/18-三体综', '新生儿中1/5000，流产率50%', '', '\r');
INSERT INTO `t_book` VALUES ('171', 'Patau Syndrome', '', '', '', '', '\r', '13三体', null, '', '', '临床表现重度智力低下，小头，两眼分开较远，小眼，外耳畸形，唇裂，腭裂，躯体其他发育畸形。S状的腓弓是本综合征的特异性表现。', '', 'Patau综合征/13-三体', '大多临床表现为流产，新生儿中1/4000~6000', '', '\r');
INSERT INTO `t_book` VALUES ('172', 'Klinefelter', '', '', '', '', '\r', '47,XXY', null, '', '', '男性，不育，睾丸小，可能有一些乳房发育，身材高，轻度精神缺陷，四肢长，存在智力问题的风险', '不遗传', '克氏综合征', '', '', '\r');
INSERT INTO `t_book` VALUES ('173', '', '', '', '', '', '\r', 'XYY三体', null, '', '', '患者身材高大，智力一般与正常人没有过大的差别。82%的智商比年龄相仿的兄弟姐妹稍低但不明显（约低10~15），9%与年龄相仿的兄弟姐妹智商相同。另外9%智商超过年龄相仿的兄弟姐妹。XYY 的病因是由于父亲精子形成时发生问题。问题发生在减数分裂偶线期II时，便会使精子细胞有两条Y染色体。若该颗精子和卵子结合，胚胎细胞便会有2条Y染色体。', '', '超雄综合征', '男性新生儿，1/500-1000', '', '\r');
INSERT INTO `t_book` VALUES ('174', 'Turner', '', '', '', '', '\r', '45,X', null, '', '', '女性，性发育迟缓，身材矮小，通常不育，心血管畸形，听力障碍，智力正常。临床表现为身矮、生殖器与第二性征不发育和一组躯体的发育异常。身高一般低于150厘米。女性外阴，发育幼稚，有阴道，子宫小或缺如。躯体特征为多痣、眼睑下垂、耳大位低、腭弓高、后发际低、颈短而宽、有颈蹼、胸廓桶状或盾形、乳头间距大、乳房及乳头均不发育、肘外翻、第4或5掌骨或跖骨短、掌纹通关手、下肢淋巴水肿、肾发育畸形、主动脉弓狭窄等。智力发育程度不一。', '', '特纳氏综合征', '女婴的22.2/10万', '', '\r');
INSERT INTO `t_book` VALUES ('175', 'Triple X', '', '', '', '', '\r', '47,XXX', null, '', '', '女性，正常的生殖器和生育，存在教育和情感问题的风险，早期绝经。', '不遗传', '', '女婴1/1000', '', '\r');
INSERT INTO `t_book` VALUES ('176', 'Trisomy 16', '', '16', '', '', '\r', '', null, '', '', '16三体是指16号染色体多了一条，呈三体现象（正常人每对染色体都只有二条），属于染色体数目异常疾病。由于16号染色体上包含很多基因，出现三体后这些基因无法正常表达，导致胎儿发育异常，自然流产。患有16三体的孩子是无法治疗的，基本都会流产。16三体等染色体数目异常疾病属于偶发性疾病，是在受精卵形成时或胚胎发育早期染色体分离出错导致，与上一代并无必然联系.', '', '16三体', '', '', '\r');
INSERT INTO `t_book` VALUES ('177', '48,XXYY syndrome', '', '', '', '', '\r', '48,XXYY', null, '', '', '发育迟缓，语言障碍，情绪波动，智力障碍，多动症症状，自闭症谱系障碍，身材高，脊柱侧凸，低肌张力，平脚，不育，隐睾，低睾酮', '', '48,XXYY综合征', '男性，1/18,000~ 50,000', '', '\r');
INSERT INTO `t_book` VALUES ('178', '', '', '8', '', '', '\r', '8三体', null, '', '', '中度到重度智力不全，往往有共济失调；前额常突出，眼窝较深，斜视，鼻根宽，鼻孔向上，唇厚，颌小，颧弓高，耳大；指趾曲屈，前臂后旋受限，手和足的皮纹 加深；躯干细长，骨盆狭小。大多数病人是嵌合型，病程与8-三体和正常核型细胞系的比例，纯8-三体常是患儿早期死亡的一种原因', '', '8三体', '', '', '\r');
INSERT INTO `t_book` VALUES ('179', '', '', '9', '', '', '\r', '9三体嵌合型', null, '', '', '指9号有额外染色体，但有一部分细胞9号染色体正常称为嵌合9三体综合征，其发生率及畸形和智力低下的严重程度与各组织内三体细胞所占比例一致。表现：从 胎儿期起即生长发育不良；严重智力低下；前额倾斜，额窄，睑裂短，眼窝深，鼻梁高，鼻根短，鼻尖小而肥厚，鼻孔狭长，上唇凸出，下唇回缩，颌小，耳畸形， 低位和后旋，关节挛缩，脊柱后突侧弯畸形，胸廓狭窄，骶骨骼骨翼和耻骨弓发育不良，趾骨发育不良。2/3的病人有先天性心脏病，阴茎小，隐睾，肾畸形，第 4脑室囊性扩张，和脑中线不连接。大多数患儿在生后不久死亡，幸存者几乎都有严重的动作和智力缺陷，有的病人终生卧床，有的能走路，能说一点话', '', '嵌合9三体综合征', '', '', '\r');
